import React, { useState } from 'react';
import MandateAccessButton from './mandateaccess'; // Adjust the path as per your file structure

const App = () => {
  const endpoints = [0, 1]; // Example endpoints, adjust as needed
  const [mandateDetails, setMandateDetails] = useState([]);

  const handleFetchData = async () => {
    try {
      const responsePromises = endpoints.map(endpoint =>
        fetch(`http://localhost:3010/${endpoint}`)
          .then(response => {
            if (!response.ok) {
              throw new Error(`Failed to fetch data from endpoint ${endpoint}. Status: ${response.status}`);
            }
            return response.json();
          })
      );

      const dataArray = await Promise.all(responsePromises);
      setMandateDetails(dataArray);
    } catch (error) {
      console.error('Error fetching data:', error.message);
      // Handle error state or notification here if needed
    }
  };

  return (
    <div>
      <button onClick={handleFetchData}>Generate Mandate Access</button>
      {mandateDetails.length > 0 && (
        <div>
          {endpoints.map((endpoint, index) => (
            <div key={endpoint}>
              <h2>Endpoint {endpoint} Details:</h2>
              <MandateAccessButton endpointData={mandateDetails[index]} />
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default App;
